import React from 'react';
import styled from 'styled-components';

const StyledHeader = styled.header`
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    padding: 5rem 5rem;
    display: flex;
    background-color: black;
    align-items: center;
    font-size: 3rem;
`;

function Header() {
    return (
        <StyledHeader>Hi</StyledHeader>
    )
}

export default Header;
